    return(
        // <div className="Trending">
            <Box sx={{ display: { sm: 'none', md: 'block' } }} className="Trending">
                <h2 className="title">최근 덧글</h2>
                <TrendingComponent/>
                <Link href="#" color="inherit" underline="hover"
                    variant="h6"
                    noWrap
                    sx={{ mr: 1, display: { xs: 'none', sm: 'block' } }}
